import React from 'react'
import '../Home.css';
import 'bootstrap/dist/css/bootstrap.min.css';

//import calcula from "../images/calculadora.png";

function Calculadora(){

    var var_quant = 0;
    var quantidade = document.getElementById("quantidade").value;
    var valor = document.getElementById("valor").value;
    var percentual = document.getElementById("percentual").value;
    var var_quant = valor + quantidade + percentual;
    document.getElementById("var_qnt").value = var_quant;
    
    return (
        <div class="container " style={{marginTop:'80px'}}>          
            <form id="cadastro">

            <label>Valor</label>
            <input type="text" id="valor" onblur="calcular()"/>
            

            <label>Percentual</label>
            <input type="text" id="percentual" onblur="calcular()"/>
            
            <label>Valor/Quantidade</label>
            <input type="text" id="var_qnt" value='' readonly></input>
            </form>     
        </div>

    );
}

export default Calculadora;
